import React from "react";
import Home from "../src/components/Home";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import NotFound from "./components/NotFound";
import BodyCream from "./components/BodyCream";
import BodyLotion from "./components/BodyLotion";
import BodyMists from "./components/BodyMists";

class App extends React.Component {
  render() {
    return (
      <BrowserRouter>
        <Switch>
          <Route exact path="/" components={Home} />
          <Route exact path="/BodyCream" components={BodyCream} />
          <Route exact path="/BodyLotion" components={BodyLotion} />
          <Route exact path="/BodyMists" components={BodyMists} />
          <Route component="*" components={NotFound} />
        </Switch>
      </BrowserRouter>
    );
  }
}

export default App;
